import * as React from 'react';
import { StrictMode } from 'react';
import { createRoot } from 'react-dom/client';

import App from './App';

const rootElement = document.getElementById('root'); // HTMLElement | null

if (rootElement) {
  // Proceed with using rootElement since it's guaranteed to be an HTMLElement
  const root = ReactDOM.createRoot(rootElement); // Assuming you're using React 18
  root.render(<App />);
} else {
  console.error('Root element not found');
}
